  final int topBound=getPaddingTop();
  int x=(int)(slideOffset * (getWidth() - transformer.getMinWidth()));
  int y=(int)(topBound + slideOffset * getVerticalDragRange());
  if (viewDragHelper.smoothSlideViewTo(dragView,x,y)) {
